import React from 'react';

function Tournament({ tournament }) {
  return (
    <tr>
      <th colSpan="2">
        {tournament}
      </th>
    </tr>
  );
}

const Home = () => {
  return (
    <div
      style={{
        margin: '5vh'
      }}
    >
      <h1>Willkommen auf Competico, der einzig wahren E-Sports-Turnier-Website</h1>

      <Tournament />
    </div>
  );
};
  
export default Home;
